import React from "react";
import { Routes ,Route } from 'react-router-dom';
import Navbar from "./components/Navbar";
const App = () => {
  return (
  <div>
    <Navbar/>
    <Routes>
      <Route path="/"></Route>
      <Route path="/about"></Route>
      <Route path="/contact"></Route>
      <Route path="/services"></Route>
    </Routes>
  </div>
  )
}

export default App;
